import React from "react";
import bg from "./../../public/assets/images/bgcareer.jpg";

function Career() {
  return (
    <div
      className="card"
      style={{ background: "linear-gradient(#e66465, #9198e5);" }}
    >
      <img src="bg" alt="" />
    </div>
  );
}

export default Career;
